import React from "react";

import { logout } from "../../config";

import { Wrapper, Content, Text } from "./NavBar.styles";

const Navbar = () => {

  return (
  <Wrapper>
    <Content>
    <h1>Mixed Tape</h1>
      <Text>
        <li>Home</li>
        <li>Playlists</li>
        <button onClick={logout}>Log Out</button>
      </Text>
    </Content>
  </Wrapper>
  )};

export default Navbar;
